import React from "react";

const LoginPage = () => {
  return (
    <div>
      <p>Login Page</p>
      <form>
        <input type="text" placeholder="email" />
        <input type="text" placeholder="password" />
        <button>Login</button>
      </form>
    </div>
  );
};

export default LoginPage;
